CREATE TABLE CLINICAL_TABLE
(
	CLINICAL_TABLE_ID   NUMBER(38) NOT NULL,
	TABLE_NAME          VARCHAR2(50) NOT NULL,
	JOIN_FOR_SAMPLE     VARCHAR2(1000) NOT NULL,
	JOIN_FOR_PATIENT    VARCHAR2(1000) NOT NULL
);

CREATE TABLE CLINICAL_XSD_ELEMENT
(
	CLINICAL_XSD_ELEMENT_ID  NUMBER(38) NOT NULL,
	ELEMENT_NAME             VARCHAR2(100) NOT NULL,
	IS_PROTECTED             NUMBER(1) DEFAULT 0 NOT NULL
);

CREATE TABLE CLINICAL_FILE
(
	CLINICAL_FILE_ID   NUMBER(38) NOT NULL,
	FILENAME           VARCHAR2(50) NOT NULL,
	BY_PATIENT         NUMBER(1) DEFAULT 0 NOT NULL
);

CREATE TABLE CLINICAL_FILE_ELEMENT
(
	CLINICAL_FILE_ELEMENT_ID  NUMBER(38) NOT NULL,
	XSD_ELEMENT_ID            NUMBER(38),
	TABLE_ID                  NUMBER(38) NOT NULL,
	TABLE_COLUMN_NAME         VARCHAR2(50) NOT NULL,
	FILE_COLUMN_NAME          VARCHAR2(50) NOT NULL,
	FILE_COLUMN_ORDER         NUMBER(38) NOT NULL,
	CLINICAL_FILE_ID          NUMBER(38),
	DISEASE_ID                NUMBER(38)
);

ALTER TABLE CLINICAL_FILE_ELEMENT ADD UNIT_COLUMN_NAME VARCHAR(50);

ALTER TABLE CLINICAL_TABLE ADD CONSTRAINT PK_CLINICAL_TABLE
	PRIMARY KEY (CLINICAL_TABLE_ID);

ALTER TABLE CLINICAL_XSD_ELEMENT ADD CONSTRAINT PK_CLINICAL_XSD_ELEMENT
	PRIMARY KEY (CLINICAL_XSD_ELEMENT_ID);

ALTER TABLE CLINICAL_FILE ADD CONSTRAINT PK_CLINICAL_FILE
	PRIMARY KEY (CLINICAL_FILE_ID);

ALTER TABLE CLINICAL_FILE_ELEMENT ADD CONSTRAINT PK_CLINICAL_ELEMENT
	PRIMARY KEY (CLINICAL_FILE_ELEMENT_ID);

ALTER TABLE CLINICAL_TABLE
	ADD CONSTRAINT UQ_CLINICAL_TABLE_TABLE_NAME UNIQUE (TABLE_NAME);

ALTER TABLE CLINICAL_XSD_ELEMENT
	ADD CONSTRAINT UQ_CLINICAL_XSD__ELEMENT_NAME UNIQUE (ELEMENT_NAME);

ALTER TABLE CLINICAL_FILE
	ADD CONSTRAINT UQ_CLINICAL_FILE_FILENAME UNIQUE (FILENAME);

ALTER TABLE CLINICAL_FILE_ELEMENT ADD CONSTRAINT FK_CLINICAL_FILE_CLINICAL_FILE
	FOREIGN KEY (CLINICAL_FILE_ID) REFERENCES CLINICAL_FILE (CLINICAL_FILE_ID);

ALTER TABLE CLINICAL_FILE_ELEMENT ADD CONSTRAINT FK_CLINICAL_FILE_CLINICAL_TABL
	FOREIGN KEY (TABLE_ID) REFERENCES CLINICAL_TABLE (CLINICAL_TABLE_ID);

ALTER TABLE CLINICAL_FILE_ELEMENT ADD CONSTRAINT FK_CLINICAL_FILE_CLINICAL_XSD_
	FOREIGN KEY (XSD_ELEMENT_ID) REFERENCES CLINICAL_XSD_ELEMENT (CLINICAL_XSD_ELEMENT_ID);

ALTER TABLE CLINICAL_FILE_ELEMENT ADD CONSTRAINT FK_CLINICAL_FILE_ELEM_DISEASE
        FOREIGN KEY (DISEASE_ID) REFERENCES DISEASE (DISEASE_ID);

CREATE SEQUENCE CLINICAL_FILE_ELEMENT_SEQ
START WITH 1
INCREMENT BY 1
NOCACHE
NOCYCLE
;









































